cmkysz11w000zpndkju5wsxsy	cmkysz0wq000ipndkq3f3fqp9	1	{"status": "FINALIZED", "eixoRespostas": [{"eixoKey": "governanca", "solucaoNota": 6, "negativoNota": 8, "positivoNota": 6, "solucaoParte1": ["Criar Comitê Municipal de Governança de Compras (representantes da Fazenda", "SADS", "Procuradoria", "Controle Interno", "TI", "e secretarias maiores). Função: aprovar PAC", "priorizar demandas", "revisar compras emergenciais. Parte 2: Descentralizar via Núcleos de Demanda: cada secretaria com ponto focal (responsável técnico) e metas de capacitação."], "solucaoParte2": null, "negativoParte1": ["Centralização das demandas em única secretaria: cria gargalos e ponto único de falha."], "negativoParte2": "Ausência de governança cross-secretarial (comitê de compras, conselho de priorização) — decisões reativas.", "positivoParte1": [], "positivoParte2": "Bloqueio orçamentário obrigatório antes da abertura de licitações (sem RP): demonstra disciplina fiscal e planejamento orçamentário mínimo.", "solucaoDescricao": "", "solucaoSebraeDescs": ["", "", "", "", "", "", "", "", "", ""], "solucaoNotaConsultor": 6, "negativoNotaConsultor": 8, "positivoNotaConsultor": 6}, {"eixoKey": "capacitacao", "solucaoNota": 6, "negativoNota": 8, "positivoNota": 8, "solucaoParte1": ["Plano de Cargos e Salários e Carreira Técnica para compras/contratações: criar incentivos não apenas temporários (gratificação)", "mas progressão por competências. Parte 2: Trilha de capacitação modular: básico (Lei 14.133/2021", "modalidades)", "intermediário (planejamento", "formação de preços", "RP)", "avançado (contratação por resultado", "gestão contratual). Parcerias com TCE-PE", "ENAP", "CNM. Parte 3: Programa de Sucessão e Banco de Conhecimento: manuais", "checklists", "templates e gravações de treinamentos. Parte 4: Contratação/terceirização pontual de especialistas (por projeto) para atividades críticas enquanto a equipe é reforçada. Parte 5: Alocação de equipes por volume: escalonar FTEs por trimestre (ex.: periodização de demandas). 4.2.3"], "solucaoParte2": null, "negativoParte1": ["Quadro reduzido e sobrecarga gera baixa resilência operacional."], "negativoParte2": "Capacitação insuficiente e esporádica, sem trilhas formais de desenvolvimento.", "positivoParte1": ["Gratificação indica reconhecimento e estímulo", "pode ser base para política de carreira."], "positivoParte2": "Existência de servidores com competência (implícito pela operacionalização via 1Doc) — núcleo técnico já existe.", "solucaoDescricao": "", "solucaoSebraeDescs": ["", "", "", "", "", "", "", "", "", ""], "solucaoNotaConsultor": null, "negativoNotaConsultor": 8, "positivoNotaConsultor": 8}, {"eixoKey": "riscos", "solucaoNota": 6, "negativoNota": 6, "positivoNota": 7, "solucaoParte1": [], "solucaoParte2": null, "negativoParte1": ["Fluxo burocrático sem foco em controles preventivos e análise de risco. Parte 2: Centralização que aumenta risco de fraqueza interna (conflitos de interesse", "ausência de segregação de função). Parte 3: Falta de matriz de riscos formal para contratações (identificação", "classificação", "mitigação). Parte 4: Insuficiência de controles contínuos e monitoramento de contratos (execução", "aditivos", "medições). 4.2.3.3"], "negativoParte2": null, "positivoParte1": ["Bloqueio orçamentário prévio é um controle forte contra atos sem lastro financeiro."], "positivoParte2": "Digitalização parcial (1Doc) facilita rastreabilidade e auditoria futura. 4.2.3.2", "solucaoDescricao": "", "solucaoSebraeDescs": ["", "", "", "", "", "", "", "", "", ""], "solucaoNotaConsultor": 6, "negativoNotaConsultor": null, "positivoNotaConsultor": null}, {"eixoKey": "digitalizacao", "solucaoNota": 7, "negativoNota": 6, "positivoNota": 7, "solucaoParte1": ["Mapear e redesenhar fluxos no 1Doc com integração de validações automáticas e templates inteligentes."], "solucaoParte2": "Integrar 1Doc ao ERP financeiro / folha / Portal da Transparência (API ou exportadores regulares) para visibilidade orçamentária e execução. Parte 3: Implementar BI de Compras (dashboards de volume, gasto por fornecedor, tempo por etapa, compliance). Parte 4: Catálogo eletrônico de itens e fornecedores com contratos quadro (RP) e histórico de preços. Parte 5: Automação de checklists legais (ex.: documentos fiscais, certidões) para reduzir conferência manual. Parte 6: Plano de continuidade e segurança da informação (backup, criptografia, gestão de acessos). 4.2.5", "negativoParte1": ["Possível subutilização do 1Doc (fluxos mal desenhados ainda). Parte 2: Falta de integração com outros sistemas essenciais (ERP financeiro", "Portal da Transparência", "PNCP/SEI", "base de fornecedores)"], "negativoParte2": null, "positivoParte1": ["Implantação do 1Doc: base tecnológica já existe", "com integração entre secretarias."], "positivoParte2": "Registro e trilha documental: facilita auditoria e traz maior transparência comparado ao papel. 4.2.4.2", "solucaoDescricao": "", "solucaoSebraeDescs": ["", "", "", "", "", "", "", "", "", ""], "solucaoNotaConsultor": null, "negativoNotaConsultor": 6, "positivoNotaConsultor": null}, {"eixoKey": "sustentabilidade", "solucaoNota": 0, "negativoNota": 6, "positivoNota": 0, "solucaoParte1": [], "solucaoParte2": null, "negativoParte1": ["Ausência de política municipal de compras sustentáveis", "nem diretrizes internas que incentivem critérios socioambientais nas contratações. Baixa integração com políticas públicas de inclusão socioeconômica", "como cooperativas", "agricultura familiar ou fornecedores locais. Inexistência de indicadores de sustentabilidade (ex.: % de compras sustentáveis", "consumo energético", "materiais recicláveis). Capacitação insuficiente em temas de sustentabilidade e compras verdes. Editais e termos de referência ainda baseados em critérios meramente técnicos e de menor preço", "sem considerar ciclo de vida do produto. 4.2.5.3"], "negativoParte2": null, "positivoParte1": [], "positivoParte2": null, "solucaoDescricao": "", "solucaoSebraeDescs": ["", "", "", "", "", "", "", "", "", ""], "solucaoNotaConsultor": null, "negativoNotaConsultor": null, "positivoNotaConsultor": null}, {"eixoKey": "mpe", "solucaoNota": 0, "negativoNota": 0, "positivoNota": 0, "solucaoParte1": [], "solucaoParte2": null, "negativoParte1": [], "negativoParte2": null, "positivoParte1": [], "positivoParte2": null, "solucaoDescricao": "", "solucaoSebraeDescs": ["", "", "", "", "", "", "", "", "", ""], "solucaoNotaConsultor": null, "negativoNotaConsultor": null, "positivoNotaConsultor": null}, {"eixoKey": "lei14133", "solucaoNota": 6, "negativoNota": 6, "positivoNota": 6, "solucaoParte1": ["Elaborar Manual de Planejamento e Contratações", "alinhado à Lei 14.133/2021 e regulamentações federais. Publicar o Plano Anual de Contratações (PAC) no PNCP e no portal municipal", "conforme art. 12. Implementar Matriz de Riscos padronizada para cada categoria de objeto. Atualizar decretos e instruções normativas municipais", "substituindo referências à Lei 8. Ampliar capacitações sobre temas da nova lei", "especialmente gestão contratual", "contratações sustentáveis e mecanismos de integridade. Instituir Comitê de Governança das Contratações", "conforme art. 11", "com atribuições formais e atas públicas. Integrar 1Doc ao PNCP para publicação automática de documentos", "reduzindo falhas de transparência. Adotar modelo de governança contratual", "com monitoramento de desempenho e encerramento formal dos contratos (art. 174 e seguintes) Governança e Planejamento:"], "solucaoParte2": null, "negativoParte1": ["Planejamento ainda centralizado e operacional", "sem completa aplicação do ciclo previsto nos arts. 18 a 40 da Lei 14.133/2021. Ausência de Plano Anual de Contratações consolidado e publicado", "que é obrigação normativa. Inexistência de matriz formal de riscos (art. 20 e 22 da Lei). Capacitação limitada em novas modalidades (diálogo competitivo", "contratação integrada", "por resultado). Falta de normativos complementares internos (instruções", "manuais", "fluxogramas e templates padronizados). Integração incompleta ao PNCP e ausência de governança contratual formal. 4.2.7.3"], "negativoParte2": null, "positivoParte1": ["Existência de Decreto Municipal regulamentador das etapas do planejamento da contratação", "evidenciando adequação progressiva à nova lei. Controle e reserva orçamentária obrigatória: conduta em total aderência ao art. 18 da Lei 14.133/2021. Implantação de fluxo digital (1Doc) compatível com as exigências de rastreabilidade e transparência previstas na norma. Reconhecimento formal de papéis (gestor", "fiscal", "agente de contratação", "pregoeiro)", "em linha com as competências da nova legislação. Avanços na transparência (publicação de documentos", "tramitação digital e registro no PNCP", "se existente) 4.2.7.2"], "positivoParte2": null, "solucaoDescricao": "", "solucaoSebraeDescs": ["", "", "", "", "", "", "", "", "", ""], "solucaoNotaConsultor": null, "negativoNotaConsultor": null, "positivoNotaConsultor": null}], "municipioNome": "MORENO", "perguntasChave": {"pcaPacPncp": "( ) PNCP", "sebraeSolucoes": ["•  Quais são as alternativas de suporte ao planejamento da Contratação do Sebrae;"], "beneficiosLc123": "•  São aplicados todos os benefícios da Lei Complementar 123/2006;", "consultorAnalise": null, "salaEmpreendedor": "•  Qual a interação com a Sala do Empreendedor na divulgação de compras;", "sistemasUtilizados": ["•  Quais sistemas o município utiliza para compras públicas?"], "integracaoPlanejamento": "•  Existe integração entre o setor de planejamento e o setor de compras?", "estrategiasFornecedores": "•  Qual a interação e informação dos fornecedores para fazer frente às oportunidades do", "tramitacaoEletronicaNota": 0, "integracaoSustentabilidade": "•  Qual a integração das políticas públicas de sustentabilidade, agricultura familiar e", "tramitacaoEletronicaComentario": null}, "respondentName": "ELVSON HENRIQUE | 2  Objetivo | Avaliar a maturidade dos municípios em relação às prátic