 null, "positivoNotaConsultor": null}, {"eixoKey": "riscos", "solucaoNota": 0, "negativoNota": 6, "positivoNota": 0, "solucaoParte1": [], "solucaoParte2": null, "negativoParte1": ["Apesar dos avanços", "ainda há fragilidade na identificação e no monitoramento de riscos nas contratações. Falta um sistema estruturado de controle interno preventivo e auditorias regulares para detectar falhas antes que causem prejuízos. A limitação de pessoal técnico e a ausência de ferramentas específicas de acompanhamento também reduzem a efetividade do controle e a confiabilidade das informações. 4.2.3.3"], "negativoParte2": null, "positivoParte1": [], "positivoParte2": null, "solucaoDescricao": "", "solucaoSebraeDescs": ["", "", "", "", "", "", "", "", "", ""], "solucaoNotaConsultor": null, "negativoNotaConsultor": null, "positivoNotaConsultor": null}, {"eixoKey": "digitalizacao", "solucaoNota": 0, "negativoNota": 0, "positivoNota": 6, "solucaoParte1": [], "solucaoParte2": null, "negativoParte1": [], "negativoParte2": null, "positivoParte1": ["Itambé tem avançado na digitalização dos processos de compras públicas", "utilizando o pregão eletrônico e divulgando editais e contratos em seu portal da transparência. Essas ações facilitam o acesso às informações", "aumentam a competitividade e reduzem a burocracia nas contratações. 4.2.4.2"], "positivoParte2": null, "solucaoDescricao": "", "solucaoSebraeDescs": ["", "", "", "", "", "", "", "", "", ""], "solucaoNotaConsultor": null, "negativoNotaConsultor": null, "positivoNotaConsultor": null}, {"eixoKey": "sustentabilidade", "solucaoNota": 0, "negativoNota": 0, "positivoNota": 0, "solucaoParte1": [], "solucaoParte2": null, "negativoParte1": [], "negativoParte2": null, "positivoParte1": [], "positivoParte2": null, "solucaoDescricao": "", "solucaoSebraeDescs": ["", "", "", "", "", "", "", "", "", ""], "solucaoNotaConsultor": null, "negativoNotaConsultor": null, "positivoNotaConsultor": null}, {"eixoKey": "mpe", "solucaoNota": 0, "negativoNot